import { makeStyles } from "@material-ui/core";
import { colors } from "../../../../themes/colors";

export const useStyles = makeStyles((theme) => ({
  btn: {
    padding: theme.spacing(1),
    color: "#000",
    width: "30%",
  },
  formText: {
    width: "45%",
  },
  formControl: {
    width: 200,
    margin: theme.spacing(3),
  },
  ContainerForm1: {
    backgroundColor: "#ccc",
    width: "90%",
  },
}));
